Comment:
- Nếu lần đầu mà tìm theo địa chỉ số 9 thì sẽ có nhiều người lẫn lộn vì đoạn đầu của phố này đánh số linh tinh, lúc chẵn, lúc lẻ. Mách nhỏ cho bạn sau đi cứ tìm Đình Làng Hậu gần Maxx Càe, cứ đâm thẳng vào sẽ thấy quán luôn;
- Quán này chỉ kinh doanh 2 tầng, trước là bán cả đồ ăn và trà đạo theo văn hoá Nhật Bản, giờ tập trung bán đồ uống, và chủ yếu là Matcha, kiểu ngồi toàn là ngồi bệt;
- Nhân viên không chuyên nghiệp lắm, thái độ phục vụ tốt;
- Đồ uống không có gì đặc sắc, chỉ đạt mức trung bình, vị trí không được đẹp nên khách không đông lắm.

Mình có gọi những món sau: 
1. Món trứng cút lộn xào me kiểu trứng không được tươi ăn k ngon;
2. Mẹt ăn vặt size L có nem chua rán ăn ỉu ăn chán vc, phomai que thì ăn dở k chịu được ỉu, khoai tây rán cũng ỉu, tok lắc phomai cứng như đá k thể ăn được.                         
3. Tokbokki và gà viên sốt tok là món tệ nhất cứng như đá như kiểu chưa được đun vậy, yêu cầu shop xem lại chứ mình đổ hết đi k ăn được gần 100k chứ ít gì; 
5. Chân gà xả ớt ăn cũng tạm chấp nhận được mà hơi nhạt chắc là món tạm được duy nhất; 
6. Chân gà sốt me thì k có mùi me nào mà ăn nó cứ kiểu ngọt ngọt k và bị nhạt chân còn bé nữa;
7. Nem chua rán thì ỉu lắm mỡ
Mong shop phản hồi lại chứ mình gọi  300k mà ăn k ra gì ( món nào cũng bị nhạt)
